    null,nt"notes": "HR Connect is the USAID HR personnel system which allows HR
    professionals to process HR actions related to employee's personal and position
    information. This system currently collects and maintains all personnel data related
    to this Agency's direct hires and U.S. Personal Services Contractors.  HR Connect's
    self-service component allows employees to log in and view their personnel data.
    Employees also have the ability to maintain items such as address, education, veteran's
    preference, disability, certificates, and emergency contact information. Managers
    will have the ability to initiate actions such as promotions, change in duty locations,
    extensions, retirements, and reassignments.",nt"license_title": "Other License
